import React, { useState } from "react";
import imageMyAcc from "../../../assets/hero.svg";
import { IoMdEye } from "react-icons/io";
import scss from "../myAcc/MyAccount.scss";

const MyAccount = () => {
  const [see, setSee] = useState(true);

  return (
    <div className={scss.myAcc}>
      <img src={imageMyAcc} alt="" />
      <div className="container">
        <div className={scss.myAccInputs}>
          <input type="email" />
          <div className={scss.input}>
            <input type={see ? "password" : "text"} />
            <IoMdEye onClick={() => setSee(!see)} />
          </div>
        </div>
      </div>
    </div>
  );
};

export default MyAccount;
